import React from 'react';
import Nav from './Nav';
import useFetchUser from './useFetchUser';
import './css/main.css';
import { useNavigate } from 'react-router-dom';

function Main() {
    const { user } = useFetchUser();
    const navigate = useNavigate();

    return (
        <div style={{ display: 'flex', flex: 1 }}>
            <header>
                <Nav user={user} />
            </header>
        </div>
    );
}

export default Main;
